import React, { useState } from 'react'
import { useNavigate } from 'react-router-dom'

const Home = () => {
    const navigate=useNavigate()
    let [roomid,setroomid]=useState("")
    let [username,setusername]=useState("")
    function roomidchange(e)
    {
        setroomid(e.target.value)
        console.log(roomid)
          
    }
    function usernamechange(e)
    {
        setusername(e.target.value)
        console.log()
    }
    function joinroom(event)
    {
        event.preventDefault()
        if(roomid&&username)
        {
            navigate("/editor/:id")
        }
        else
        {
            alert("enter valid username and roomid")
        }       
    }
  return (
    <div>
        This is home page
        <div>
            <img src="Images\codecast.png" alt='codecollab'></img>
            <h1>enter the room id</h1>
            <input type='number' placeholder='Enter Room Id' className='text-black' onChange={roomidchange}></input><br></br>
            <input type='text' placeholder='Username' className='text-black' onChange={usernamechange}></input><br></br>
            <button onClick={joinroom}>Join</button>
            <p>Dont't have Room id ? create <span className="text-green-600">New Room Id</span></p>
        </div>
    </div>
  )
}
export default Home
